// Set the number of cores.
specification.setCores(cores = 9)
// Set the cluster type.
specification.setType(type = "psock")

// Start the backend.
backend.start(specification = specification)
// Define some task.
function task = ...
// Run the task in parallel.
backend.sapply(x = x, fun = task, ...)
// Get the results.
vector output = backend.getOutput()
// Stop the backend.
backend.stop()

