// Create a backend factory.
BackendFactory factory = new BackendFactory()
// Get a backend instance of desired type.
Backend backend = factory.get(type = "sync")

// Create context manager factory to consume the backend.
ContextFactory contextFactory = new ContextFactory()
// If the backend supports progress tracking.
if (backend.supportsProgress())
// Use a progress-capable context.
Context context = contextFactory.get(type = "progress")
// Create a progress bar factory.
BarFactory barFactory = new BarFactory()
// Get a bar instance.
Bar bar = barFactory.get(type = "modern")
// Set the bar on the context.
context.setBar(bar)
// Configure the bar.
context.configureBar(...)
// Otherwise.
else
// Use a standard context.
Context context = contextFactory.get(type = "regular")

// Start the backend.
context.start(specification = specification)
// Define some task.
function task = ...
// Run the task in parallel (i.e., with potential decorations).
context.sapply(x = x, fun = task, ...)
// Get the results.
vector output = context.getOutput()
// Stop the backend.
context.stop()

// Create cluster specification.
Specification specification = new Specification()
// Set the number of cores.
specification.setCores(cores = 9)
// Set the cluster type.
specification.setType(type = "psock")

if (type == "basic")
return new BasicBar()
else if (type == "modern")
return new ModernBar()
else
throw error("not implemented")

// Create a bar factory.
BarFactory factory = new BarFactory()
// Get a bar instance of desired type.
Bar bar = factory.get(type = "modern")

// Create the bar.
bar.create(total = 100, initial = 0)
// Update the bar.
bar.update(current = 50)
// Terminate the bar.
bar.terminate()
